import React from "react";
import emailjs from "emailjs-com"; // Adicionando o EmailJS
import TextField from "@material-ui/core/TextField";
import { Box, Button } from "@mui/material";
import WhatsAppIcon from "../../assets/whatsapp-svgrepo-com.svg";
import DonoPet from "../../assets/img_animal/model-contact.png";
import "./Contato.css";

export default function Contato() {
  const sendEmail = (e) => {
    e.preventDefault();

    emailjs
      .sendForm(
        'service_px5yag2', // substitua pelo ID do servi√ßo de email
        'template_uuquj9e', // substitua pelo ID do template
        e.target,
        'YOUR_USER_ID' // substitua pelo seu User ID
      )
      .then(
        (result) => {
          console.log(result.text);
          alert('Mensagem enviada com sucesso!');
        },
        (error) => {
          console.log(error.text);
          alert('Ocorreu um erro ao enviar a mensagem.');
        }
      );
  };

  const handleSendWhatsAppMessage = () => {
    let message = `Ol√°, gostaria de agendar uma consulta para meu pet. üêæ \n\nPor favor, entre em contato para verificar a disponibilidade.`;
    window.open(
      `https://wa.me/5521965502519?text=${encodeURIComponent(message)}`
    );
  };

  return (
    <div className="container-form">
      <h1>Contato</h1>
      <div className="container-main-form">
        <div className="infos-left">
          <h3>Endere√ßo</h3>
          <p>R. Equador, 480 - Nossa Sra. da Concei√ß√£o, Paulista - PE, 53429-630</p>
          <h3>Telefone</h3>
          <p>(81) 98105-6762</p>
          <h3>Email</h3>
          <p>clinica@gmail.com</p>
        </div>
        <div className="title-subtitle">
          <h1>Envie-nos uma mensagem</h1>
          <p className="subtitle">Se precisar de alguma ajuda, estamos √† sua disposi√ß√£o.</p>

          <form onSubmit={sendEmail}> {/* Usando a fun√ß√£o sendEmail */}
            <Box className="container-box-primary">
              <Box p={3} className="container-dados">
                <div className="text">
                  <TextField fullWidth label="Nome" name="name" required />
                  <TextField fullWidth label="Email" name="email" required />
                  <TextField fullWidth label="DDD + Telefone ou Celular" name="phone" required />
                  <TextField
                    fullWidth
                    label="Mensagem"
                    name="message"
                    multiline
                    rows={4}
                    required
                  />
                </div>
              </Box>
            </Box>

            <div className="button">
              <Button
                className="button-form-dados"
                type="submit"
                variant="contained"
                color="primary"
              >
                Enviar Mensagem
              </Button>
            </div>
          </form>
        </div>
      </div>
      {/* Agende sua visita */}
      <div className="schedule-section-sobre">
        <div className="schedule-text">
          <h2>Agende sua visita</h2>
          <p>
            Agende sua visita e garanta o melhor cuidado para o seu pet! Nossa equipe especializada est√°
            pronta para oferecer um atendimento de qualidade, com todo carinho e dedica√ß√£o que seu amigo de
            quatro patas merece.
          </p>
          <button className="button-home-section" onClick={handleSendWhatsAppMessage}>
            <img
              src={WhatsAppIcon}
              alt="WhatsApp"
              style={{ marginRight: "8px", width: "20px", height: "20px" }}
            />
            Entre em contato
          </button>
        </div>
        <div className="schedule-image">
          <img src={DonoPet} alt="Dono com seu pet" />
        </div>
      </div>
    </div>
  );
}
